    return (
        <nav className="navbar">
            <div className="container">
                <div className="nav-elements">
                    <div className='menu'>
                        <NavLink>
                            Home
                        </NavLink>
                    </div>
                </div>
            </div>
        </nav>
    )

}
export default Header
